package com.canda.test.file;

import java.io.File;

import javax.imageio.stream.FileImageOutputStream;

/**
 * @author Wangkun
 * @since 2018/11/1 下午2:24
 */
public class Hex2Picture {

    /**
     * 十六进制字节转字节数组 Creates byte array representation of HEX string.<br>
     * http://www.cnblogs.com/qgc88
     * 
     * @param s
     *            string to parse
     * @return
     */
    public static byte[] fromHexString(String s) {
        int length = s.length() / 2;
        byte[] bytes = new byte[length];
        for (int i = 0; i < length; i++) {
            bytes[i] = (byte)((Character.digit(s.charAt(i * 2), 16) << 4) | Character.digit(s.charAt((i * 2) + 1), 16));
        }
        return bytes;
    }

    /**
     * Creates HEX String representation of supplied byte array.<br/>
     * Each byte is represented by a double character element from 00 to ff 实现字节数组向十六进制的转换方法一
     * http://www.cnblogs.com/qgc88
     * 
     * @param fieldData
     *            to be tringed
     * @return
     */
    public static String toHexString(byte[] fieldData) {
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < fieldData.length; i++) {
            int v = (fieldData[i] & 0xFF);
            if (v <= 0xF) {
                sb.append("0");
            }
            sb.append(Integer.toHexString(v));
        }
        return sb.toString();
    }

    public static void byte2image(byte[] data, String path) {
        if (data.length < 3 || path.equals("")) {
            return;
        }
        try {
            FileImageOutputStream imageOutput = new FileImageOutputStream(new File(path));
            imageOutput.write(data, 0, data.length);
            imageOutput.close();
            System.out.println("Make Picture success,Please find image in " + path);
        } catch (Exception ex) {
            System.out.println("Exception: " + ex);
            ex.printStackTrace();
        }
    }

    public static void main(String[] args) {
        String str5 =
            "";
        String str6 = "";
        byte[] t = fromHexString(str5 + str6);
        byte2image(t, "/work/temp/7.jpg");// 转成保存图片
    }
}
